import './App.css';
import avatar from './assets/contacts/saitama.png.webp'
import Header from './components/Header/Header';
import { Routes, Route } from 'react-router-dom'
import { Fake } from './components/Fake/Fake'


function App() {
	return (
		<div className="App">
			<div className='header'>
				<Header />
			</div>
			<div className='left-block'>search + active contact</div>
			<div className='right-block'>
				<Routes>
					<Route path='/home' element={<Fake elem='home' />} />
					<Route path='/chat' element={<Fake elem='chat' />} />
					<Route path='/contacts' element={<Fake elem='contacts' />} />
					<Route path='/settings' element={<Fake elem='settings' />} />
					<Route path='/faq' element={<Fake elem='faq' />} />
				</Routes>
			</div>
		</div>
	);
}

const AsideBar = () => {
	return (
		<div>
			<img src={avatar}></img>
		</div>
	)
}

export default App;
